    'Please activate the \'mod_auth_basic\' Apache module to allow authentication of PrestaShop\'s webservice.' => 'Aktywuj proszę moduł Apache \'mod_auth_basic\' aby zezwolić na uwierzytelnianie API PrestaShop.',
