    'If you need to restore a database backup, we invite you to subscribe to a [1][2]technical support plan[/2][/1].' => 'Jeśli chcesz przywrócić kopię zapasową bazy danych, zapraszamy do subskrybowania [1][2]planu wsparcia technicznego[/2][/1].',
