  'AdminDesignHelp' => 
  array (
    'By default, all images settings are already installed in your store. Do not delete them, you will need it!' => 'Domyślnie wszystkie ustawienia obrazów są już zainstalowane w Twoim sklepie. Nie usuwaj ich, będziesz je potrzebować!',
    'Regenerates thumbnails for all existing images' => 'Generuje ponownie miniatury dla wszystkich istniejących zdjęć',
    'Please be patient. This can take several minutes.' => 'Bądź cierpliwy, to może zająć kilka minut',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Ostrożnie! Ręcznie wgrane miniatury zostaną usunięte i zastąpione automatycznie generowanymi miniaturami.',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Wybierz "Nie" tylko wtedy, gdy skończył się czas serwera i musisz powtórzyć generowanie.',
    'Please select a module' => 'Proszę wybrać moduł',
    'Select a module above before choosing from available hooks' => 'Wybierz moduł, aby móc wybrać jeden z dostępnych zaczepów',
    'Please specify the files for which you do not want the module to be displayed.' => 'Proszę podaj pliki dla których nie chcesz żeby ten moduł był wyświetlany',
    'Please input each filename, separated by a comma (",").' => 'Wpisz każdą nazwę, rozdziel je przecinkami (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Możesz także kliknąć nazwę pliku na poniższej liście, a nawet dokonać wielokrotnego wyboru trzymając wciśnięty klawisz Ctrl podczas klikania, lub wybrać cały zakres nazw plików trzymając w czasie klikania klawisz Shift.',
    'To add "tags" click in the field, write something, and then press "Enter."' => 'Aby dodać "tagi" kliknij w polu, napisz coś, następnie naciśnij "Enter".',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'Zdjęcia JPEG mają mały rozmiar i standardową jakość. Zdjęcia PNG mają większe pliki, lepszą jakość i obsługują przezroczystości. Zapamiętaj, że we wszystkich przypadkach pliki zdjęć będą miały rozszerzenie .jpg.',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'UWAGA: Ta funkcja może nie być kompatybilna z Twoim szablonem lub z niektórymi modułami. Dokładniej, format PNG nie jest kompatybilny z modułem Znaku Wodnego. Jeżeli wystąpią jakieś problemy, wyłącz go przez zaznaczenie "Użyj JPEG".',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Zakres od 0 (najgorsza jakość, najmniejszy plik) do 100 (najlepsza jakość, największy plik)',
    'Recommended: 90.' => 'Zalecane: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'Kompresjia PNG jest bezstratna: w przeciwieństwie do JPG, nie tracisz jakości z wysokim stopniem kompresji. Mimo tego, fotografie kompresują się bardzo źle.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Zakres od 0 (największy plik) do 9 (najmniejszy plik, wolniejsza dekompresja).',
    'Recommended: 7.' => 'Zalecana: 7.',
    'The maximum file size of pictures that customers can upload to customize a product (in bytes).' => 'Maksymalny rozmiar zdjęcia, które klienci mogą przesyłać do dostosowywania produktu (w bajtach).',
    'Width of product customization pictures that customers can upload (in pixels).' => 'Wysokość zdjęć dostosowywanych produktów, które klienci mogą przesyłać (w pikselach).',
    'Height of product customization pictures that customers can upload (in pixels).' => 'Wysokość zdjęć dostosowywanych produktów, które klienci mogą przesyłać (w pikselach).',
    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Spowoduje to wygenerowanie dodatkowego pliku dla każdego obrazu (czyli podwojenie całkowitej ilości zdjęć). Rozdzielczości tych zdjęć będzie dwa razy większa.',
    'Enable to optimize the display of your images on high pixel density screens.' => 'Włącz, aby zoptymalizować wyświetlanie obrazów na ekranie o dużej gęstości pikseli.',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Powinno to być ustawione na "Tak" chyba że pomyślnie przeniosłeś zdjęcia na stronie "Zdjęcia" w menu "Preferencje"',
    'Letters, underscores and hyphens only (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").' => 'Tylko litery, znaki podkreślenia i myślniki (np. "small_custom", "cart_medium", "large", "thickbox_extra-large").',
    'Maximum image width in pixels.' => 'Maksymalna szerokość obrazka w pikselach.',
    'Maximum image height in pixels.' => 'Maksymalna wysokość obrazka w pikselach.',
    'This type will be used for Product images.' => 'Ten typ zostanie użyty dla zdjęć Produktów.',
    'This type will be used for Category images.' => 'Ten rodzaj będzie używany dla Kategorii zdjęć.',
    'This type will be used for Brand images.' => 'Ten typ zostanie użyty dla zdjęć Marki.',
    'This type will be used for Supplier images.' => 'Ten typ zostanie użyty dla zdjęć Dostawców',
    'This type will be used for Store images.' => 'Ten typ zostanie użyty dla zdjęć Sklepów',
    'E.g. address, addresses, attachment' => 'Np. address, addresses, attachment',
    'Will appear on main page. Recommended size for the default theme: height %height% and width %width%.' => 'Pojawi się na stronie głównej. Zalecana wielkość dla domyślnego szablonu: wysokość %height% i szerokość %width%.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Uwaga: możesz użyć pliku PNG z przezroczystością, ale przetwarzanie strony może zająć do 1 sekundy. Rozważ użycie pliku w formacie JPG.',
    'It is the small icon that appears in browser tabs, next to the web address' => 'Jest to mała ikona wyświetlana na kartach przeglądarki obok adresu internetowego',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.\\nOnce you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Bądź ostrożny! Przed wygenerowaniem stylów RTL sprawdź swój szablon w języku RTL: Twój szablon może być już dostosowany do RTL. \\ Po kliknięciu na "Dostosuj do RTL", dowolny plik RTL, który mógł zostać dodany do twojego szablonu, może zostać usunięty przez utworzony arkusz stylów.',
    'Used in the h1 page tag, and as the default title tag value.' => 'Używane w tagu h1 strony i jako domyślna wartość tagu tytułu.',
    'Used to override the title tag value. If left blank, the default title value is used.' => 'Używane do nadpisania tagu tytułowego. Jeśli pozostanie puste, zostanie użyta domyślna wartość tytułu.',
    'Create meaningful content' => 'Stwórz wartościowe treści',
    'Because it is not just selling products but also creating a universe, build pages to tell stories and catch your visitors’ interest, to turn them into loyal customers.' => 'Nie chodzi tylko o sprzedaż produktów, ale o coś więcej, twórz strony, by opowiadać historie i wzbudzać zainteresowanie odwiedzających, tak, by stali się Twoimi klientami.',
    'Add new page category' => 'Dodaj nową kategorię strony',
    'Add new page' => 'Dodaj nową stronę',
    'This won\'t regenerate email templates, it only sets the default email theme for future generation (when a language is installed for example).' => 'Nie spowoduje to ponownego wygenerowania szablonów wiadomości e-mail, a jedynie ustawienie domyślnego motywu wiadomości e-mail dla przyszłej generacji (na przykład, gdy zainstalowany jest język).',
    'PrestaShop\'s email templates are stored in the "mails" folder, but they can be overridden by your current theme\'s own "mails" folder. Using this option enables to overwrite emails from your current theme.' => 'Szablony wiadomości e-mail PrestaShop są przechowywane w folderze „maile”, ale można je zastąpić własnym folderem „maile” bieżącego motywu. Użycie tej opcji umożliwia zastąpienie wiadomości e-mail z bieżącego motywu.',
    'By default, existing email template files are not modified to avoid deleting any modification you may have done. Enable this option to force the overwrite.' => 'Domyślnie istniejące pliki szablonów wiadomości e-mail nie są modyfikowane, aby uniknąć usunięcia wszelkich dokonanych modyfikacji. Włącz tę opcję, aby wymusić zastąpienie.',
    'No emails were detected in any theme folder so this field is disabled.' => 'Nie wykryto żadnych wiadomości e-mail w żadnym folderze motywu, więc to pole jest wyłączone.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Pojawi się na nagłówkach e-mail',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Uwaga: brak dostępnego logo dla faktury, zamiast tego zostanie użyte główne logo.',
    'Will appear on invoice headers.' => 'Pojawi się w nagłówkach faktur.',
    'Use our [1]favicon generator on PrestaShop Marketplace[/1] to boost your brand image!' => 'Użyj [1]favicon generator on PrestaShop Marketplace[/1] aby polepszyć widoczność znaku sklepu!',
    'Will appear on your main page. Recommended size for the default theme: height %height% and width %width%.' => 'Pojawi się na stronie głównej. Zalecana wielkość dla domyślnego szablonu: wysokość %height% i szerokość %width%.',
    'It is the small icon that appears in browser tabs, next to the title.' => 'Jest to mała ikona pojawiająca się na kartach przeglądarki obok tytułu.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Bądź ostrożny! Przed wygenerowaniem stylów RTL sprawdź swój szablon w języku RTL: Twój szablon może być już dostosowany do RTL.
Po kliknięciu na "Dostosuj do RTL", dowolny plik RTL, który mógł zostać dodany do twojego szablonu, może zostać usunięty przez utworzony arkusz stylów.',
    'Browse your computer files and select the Zip file for your new theme.' => 'Przeglądaj pliki swojego komputera i wybierz plik Zip z nowym szablonem.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Podaj pełny adres URL do pliku Zip z nowym szablonem w sieci. Na przykład "http://example.com/pliki/nowy-szablon.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'To pole wyboru wyświetla listę wszystkich plików Zip przesłanych do katalogu "themes".',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Musisz wybrać sklep z powyższej listy jeżeli chcesz wybrać szablon',
    'You are editing this page for a specific shop or group. Click "Yes" to check all fields, "No" to uncheck all.' => 'Edytujesz tą stronę dla określonego sklepu lub grupy. Kliknij "Tak" aby zaznaczyć wszystkie pola, "Nie" aby wszystkie odznaczyć.',
    'If you check a field, change its value, and save, the multistore behavior will not apply to this shop (or group), for this particular parameter.' => 'Jeżeli zaznaczysz pole, zmienisz jego wartość i zapiszesz, nie będzie miało ono zastosowania do tego sklepu (lub grupy), w przypadku tego określonego parametru.',
  ),
  'AdminDesignNotification' => 
  array (
    'Your page will be saved as a draft' => 'Twoja strona zostanie zapisana jako szkic',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Możesz wybrać przechowywanie swoich zdjęć w poprzednim systemie - nic w tym złego.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'Możesz także zdecydować się na przeniesienie swoich zdjęć do nowego systemu przechowywania: w tym przypadku, kliknij przycisk "Przenieś zdjęcia" poniżej. Bądź cierpliwy, może to zająć kilka minut.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Po przeniesieniu wszystkich Twoich zdjęć produktów, dla lepszej wydajności, ustaw powyższą opcję "Użyj dziedziczonego systemu plików zdjęć" na "Nie".',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Jeżeli chcesz zamówić/przenieść następujące dane, wybierz proszę sklep z listy sklepów',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Aktualny szablon jest niedostępny. Proszę sprawdzić nazwę katalogu Twojego szablonu ("%s") oraz uprawnienia.',
    'No items found' => 'Nie znaleziono przedmiotów',
    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %folder% only contains demonstration images, and then delete it.' => 'Znaleziono zduplikowane zdjęcia podczas przenoszenia zdjęć produktów. Jest to prawdopodobnie spowodowane przez niewykorzystane zdjęcia demonstracyjne. Upewnij się, że folder %folder% zawiera tylko obrazy demonstracyjne, a następnie je usuń.',
    'Incorrect value for the selected JPEG image compression.' => 'Nieprawidłowa wartość dla wybranej kompresji obrazu JPEG.',
    'Incorrect value for the selected PNG image compression.' => 'Nieprawidłowa wartość dla wybranej kompresji obrazu PNG.',
    'Source file does not exist or is empty (%filepath%)' => 'Plik źródłowy nie istnieje lub jest pusty (%filepath%)',
    'Failed to resize image file (%filepath%)' => 'Nie udało się zmienić rozmiar pliku obrazu (%filepath%)',
    'Failed to resize image file to high resolution (%filepath%)' => 'Nie udało się zmienić rozmiar pliku obrazu do wysokiej rozdzielczości (%filepath%)',
    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Oryginalne zdjęcie jest uszkodzone (%filename%) dla ID produktu %id% lub folder ma nieprawidłowe prawa dostępu.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Brakuje oryginalnego zdjęcia lub jest puste (%filename%) dla produktu o identyfikatorze %id%',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Nie można zapisać obrazu typu: %1$s. Proszę sprawdzić uprawnienia dostępu do folderu %2$s.',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'Tylko część zdjęć została zregenerowana, upłynął limit czasu serwera.',
    'Server timed out. The watermark may not have been applied to all images.' => 'Upłynął limit czasu serwera, znaki wodne nie mogły być dodane do wszystkich zdjęć.',
    'Cannot write "No picture" image to %s images folder. Please check the folder\'s writing permissions.' => 'Nie można zapisać zdjęcia "Brak zdjęcia" do folderu zdjęć %s. Proszę sprawdzić uprawnienia do zapisu w folderze.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'Błąd: konfiguracja Twojego serwera nie jest zgodna z nowym systemem zdjęć. Nie przeniesiono żadnych zdjęć.',
    'Not all images have been moved. The server timed out before finishing. Click on "Move images" again to resume the moving process.' => 'Nie wszystkie obrazy zostały przeniesione, upłynął limit czasu serwera przed ukończeniem. Kliknij na "Przenieś obrazy" aby wznowić',
    'Error: Some -- or all -- images cannot be moved.' => 'Błąd: Niektóre -- bądź wszystkie -- obrazki nie mogą być przeniesione.',
    'After modification, do not forget to regenerate thumbnails' => 'Po modyfikacji nie zapomnij ponownie wygenerować miniatur',
    'The uploaded file is too large.' => 'Przesłany plik jest zbyt duży.',
    'Failed to move uploaded file.' => 'Nie można przenieść przesłanego pliku.',
    'This theme is not valid for PrestaShop 1.7' => 'Ten szablon nie jest prawidłowy dla PrestaShop 1.7',
