  'AdminShopparametersHelp' => 
  array (
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'Istnieje ogromna ilość danych, więc każde połączenie odnoszące się do polecającego jest indeksowane. Możesz odświeżyć ten indeks klikając na poniższy przycisk. Pamiętaj że może to zająć dużo czasu i jest potrzebne tylko kiedy zmodyfikujesz lub dodasz polecającego i chcesz aby zmiany miały skutek wsteczny.',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Twoje dane są buforowane w celu sortowania i filtrowania. Można odświeżyć pamięć podręczną klikając na przycisk "Odśwież pamięć podręczną".',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Bezpośredni ruch może być całkiem wymagający dla zasobów. Powinieneś rozważyć włączenie go jeżeli masz mocny serwer baz danych i naprawdę dużą potrzebę.',
    'Show me more' => 'Pokaż więcej',
    'Definitions:' => 'Definicje:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Pole "http_referer" dotyczy strony internetowej z której pochodzi Twój klient.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'Na przykład, odwiedzający przychodzący ze strony Google będą mieli ustawioną wartość "http_referer" tak jak "http://www.google.com/search?q=twojsklep".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Jeśli użytkownik wchodzi na strony sklepu bezpośrednio (poprzez ręczne wpisanie adresu URL sklepu w przeglądarce lub za pomocą "ulubionych", "http_referer" będzie puste.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Jeśli interesują Cię odwiedzający przychodzący z google wpisz w polu "%google%, lub "%google.pl%" jeżeli interesują Cię tylko odwiedzający z polskiej strony Google.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Pole "request_uri" jest adresem URL spod, którego klient przyszedł na stronę.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'Na przykład jeśli gość wszedł na stronę produktu, adres URL będzie taki jak ten "%smusic-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Jest to pomocne, ponieważ możesz dodać kilka tagów lub znaków w linkach wskazujących na Twoją stronę.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'Na przykład możesz umieścić link (taki jak "%sindex.php?mojeslowokluczowe" -- zauważ że dodane jest "?mojeslowokluczowe" na końcu adresu URL) na forum lub jako komentarz do blogu i zobaczyć statystyki odwiedzin dla tego unikalnego linku wpisując "%%mojeslowokluczowe" w polu "request_uri".',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Ta metoda jest bardziej wiarygodna niż "http_referer", ale jest jedna wada: jeżeli wyszukiwarka zaindeksuje stronę z Twoim linkiem, wtedy zostanie on wyświetlony w wynikach wyszukiwania i nie tylko będą go używać odwiedzający z miejsc w których go umieściłeś, ale także ci z wyszukiwarki.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Pola "include" wskazują co powinno być włączone do adresu URL.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Pola "exclude" wskazują co musi być wyłączone z URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Podczas korzystania z trybu prostego, można użyć szeroki zakres ogólnych znaków, aby zastąpić inne znaki:',
    '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '"_" zastąpi jeden znak. Jeżeli chcesz użyć prawdziwego znaku "_", musisz wpisać to: "\\\\_".',
    '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" zastąpi każdą ilość znaków. Jeżeli chcesz użyć prawdziwego znaku "%", musisz wpisać to: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Tryb prosty wykorzystuje wzorzec dopasowania MySQL "LIKE", ale żeby uzyskać większy potencjał możesz użyć regularnych wyrażeń MySQL w trybie Expert.',
    'Take a look at MySQL\'s documentation for more details.' => 'Żeby uzyskać więcej szczegółów zajrzyj do dokumentacji MySQL.',
    'Get help!' => 'Uzyskaj pomoc!',
    'e.g. 10:00AM - 9:30PM' => 'Przykład: 10:00 - 21:30',
    'Further information regarding this contact.' => 'Dalsze informacje na temat tego kontaktu.',
    'Image width in pixels. Enter "0" to use the original size.' => 'Szerokość obrazu w pikselach. Wpisz "0" aby użyć oryginalnego rozmiaru.',
    'Image height in pixels. Enter "0" to use the original size.' => 'Wysokość obrazu w pikselach. Wpisz "0" aby użyć oryginalnego rozmiaru.',
    'The group defined for your un-identified visitors.' => 'Grupa zdefiniowana dla Twoich niezidentyfikowanych odwiedzających.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'Grupa zdefiniowana dla Twoich zidentyfikowanych klientów (używane podczas sprzedaży Gościom).',
    'The group defined for your identified registered customers.' => 'Grupa definiowana dla Twoich zidentyfikowanych zarejestrowanych klientów.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Automatycznie zastosuje tą wartość jako rabat na wszystkie produkty dla członków tej grupy użytkowników',
    'How prices are displayed in the order summary for this customer group.' => 'Jak są wyświetlane ceny w podsumowaniu zamówienia dla tej grupy klientów',
    'Customers in this group can view prices.' => 'Klienci w tej grupie mogą zobaczyć ceny.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - Wszystkie osoby bez konta klienta lub klienci, którzy nie są zalogowani.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - Wszystkie osoby które złożyły zamówienie z użyciem Zakupów Gościa.',
    '%group_name% - All persons who created an account on this site.' => '%group_name% - Wszystkie osoby które założyły konto na tej stronie.',
    'PrestaShop has three default customer groups:' => 'PrestaShop ma trzy domyślne grupy klientów:',
    'Need to hide prices for all groups? Save time, enable catalog mode in Product Settings instead.' => 'Nie chcesz pokazywać cen wszystkim grupom? Oszczędź więc czas i włącz tryb katalogu w Ustawieniach produktu.',
    'Leave blank if no change.' => 'Pozostaw puste jeżeli nie chcesz zmieniać.',
    'Fee given for each visit.' => 'Opłata za wizytę.',
    'Fee given for each order placed.' => 'Opłata za złożone zamówienia',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Jeśli wiesz, jak używać wyrażeń regularnych MySQL, możesz użyć [1]tryb ekspercki[/1].',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Włącz automatyczną indeksację produktów. Jeżeli włączysz tą funkcję, produkty będą indeksowane automatycznie po ich zapisaniu. Jeżeli ta funkcja będzie wyłączona, będziesz musiał zaindeksować produkty ręcznie używając linków podanych w tym polu.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Domyślnie, szukając "bluzka", musisz wpisać "bluz", "blu", itp. (początek słowa) - ale nie "luz" (część słowa).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Kiedy ta opcja jest włączona, daje także dobre wyniki kiedy szukasz "luz", "uzka" lub cokolwiek zawarte w słowie.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Włącz szukanie części słowa, zamiast tylko od jego początku.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Sprawdza czy poszukiwana fraza zawarta jest w zaindeksowanym słowie. To może wymagać wielu zasobów.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Domyślnie jeśli wyszukiwane jest „radio” użytkownik będzie miał „radio”, „radiomagnetofon” i „radiostacja”.',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Jeśli ta opcja jest włączona to daje tylko jeden wynik "radio", dopasowane jest dokładne zakończenie indeksowanego słowa.',
    'Enable more precise search with the end of the word.' => 'Umożliwia bardziej precyzyjne wyszukiwanie zakończenia słowa.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Sprawdza, czy szukana fraza jest dokładnie zakończeniem indeksowanego słowa.',
    'Only words this size or larger will be indexed.' => 'Tylko słowa o tej długości lub dłuższe zostaną zaindeksowane.',
    'Please enter the index words separated by a "|".' => 'Wpisz wyrazy oddzielone "|".',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Wprowadź każdy alias rozdzielając je przecinkami (\',\') (np. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Zabronione znaki: <>;=#{}',
    'Search this word instead.' => 'Zamiast tego szukaj tego wyrazu.',
    'This field does not refer to the shop name visible in the front office.' => 'To pole nie odnosi się do nazwy sklepu widocznej na stronie głównej.',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Użyj [1]tego linku[/1] aby edytować nazwę sklepu używaną na głównej stronie.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Ne możesz edytować grupy sklepu, ponieważ obecny sklep należy do grupy z włączoną opcją „współdzielenia”.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'To jest kategoria główna sklepu, który stworzyłeś. Aby zdefiniować nową kategorię główną dla Twojego sklepu, [1]kliknij tutaj[/1].',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Wybierając połączone kategorie, wybierasz współdzielenie kategorii pomiędzy różnymi sklepami. Po połączeniu pomiędzy sklepami, jakiekolwiek nadpisanie połączonej kategorii będzie wpływało na wszystkie sklepy do których te kategorie będą przypisane.',
    'Order status (e.g. \'Pending\').' => 'Status zamówienia (np. \'oczekuje\').',
    'Invalid characters: numbers and' => 'Błędne znaki: liczby i',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Prześlij ikonę z twojego komputera (Typ pliku: .gif, sugerowany rozmiar 16x16).',
    'Status will be highlighted in this color. HTML colors only.' => 'Status zostanie wyróżniony tym kolorem. Tylko kolory HTML.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Tylko litery, cyfry i podkreślenia ("_") są dozwolone.',
    'Email template for both .html and .txt.' => 'Szablon e-mail\'a dla .html i .txt.',
    'Order\'s return status name.' => 'Nazwa statusu zamówienia zwrotnego.',
    'Whether or not to display this store.' => 'Wyświetl sklep lub nie.',
    'Storefront picture.' => 'Zdjęcie witryny lub inne reprezentujące sklep.',
    'Displayed in emails sent to customers.' => 'Wyświetlany w e-mailach wysyłanych do klientów.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Informacja rejestracyjna sklepu (np. NIP, REGON, KRS).',
    'characters' => 'znaków',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Po tym jak klient się zaloguje, przywróć i wyświetl zawartość jego/jej ostatniego koszyka.',
    'Send an email with summary of the account information (email, password) after registration.' => 'Wyślij e-mail z podsumowaniem informacji o koncie (e-mail, hasło) po rejestracji.',
    'Minimum time required between two requests for a password reset.' => 'Minimalna ilość czasu wymagana pomiędzy dwoma żądaniami resetu hasła.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Aktywuj lub dezaktywuj tryb B2B. Kiedy ta opcja jest włączona, niektóre funkcje B2B są dostępne.',
    'Display or not the birth date field.' => 'Wyświetlaj lub nie pole data urodzin.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Wyświetlaj lub nie pole wyboru, potwierdzające chęć otrzymywania ofert od partnerów sklepu.',
    'The catalog mode is actually to disable products checkout (prices, add to cart, etc.) on your shop, like a retail website does.' => 'Tryb katalogowy polega w rzeczywistości na wyłączeniu zakupu produktów (ceny, dodawania do koszyka itp.) w sklepie, tak jak ma to miejsce w przypadku sklepów detalicznych.',
    'Set the maximum size of the summary of your product description (in characters).' => 'Określ maksymalny rozmiar krótkiego opisu produktu (w znakach).',
    'How to calculate quantity discounts.' => 'Jak obliczać rabaty ilościowe.',
    'When active, friendly URL will be updated on every save.' => 'Kiedy aktywne, przyjazny URL będzie aktualizowany przy każdym zapisie.',
    'When active, new products will be activated by default during creation.' => 'Gdy aktywne, nowe produkty będą włączone domyślnie podczas tworzenia.',
    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Tryb katalogu wyłącza koszyk w Twoim sklepie. Użytkownicy będą mogli przeglądać Twoje produkty, ale nie będą mogli ich kupić.',
    'Have specific needs? Edit particular groups to let them see prices or not.' => 'Potrzebujesz nietypowego rozwiązania? Edytuj poszczególne grupy klientów, decydując którym z nich pokazać ceny, a którym nie.',
    'Display product prices when in catalog mode.' => 'Pokaż ceny, kiedy tryb katalogu jest włączony.',
    'Set to "0" to disable this feature.' => 'Wstaw 0 , aby wyłączyć tę funkcję',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Wyświetlaj bądź nie przycisk "Dodaj do koszyka" na liście produktów danej kategorii, producenta, dostawcy w przypadku gdy ma on atrybuty. Zaleca się nie wyświetlania przycisku "Dodaj do koszyka" w przypadku gdy produkt posiada atrybuty do wyboru.',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Na ekranie rabatów ilościowych, wyświetlaj nową cenę z zastosowanym rabatem zamiast pokazywania rabatu (np. "-5%").',
    'Number of products displayed per page. Default is 10.' => 'Ilość produktów wyświetlanych na stronie. Domyślnie jest 10.',
    'The order in which products are displayed in the product list.' => 'Porządek wg którego produkty są wyświetlone na liście produktów',
    'Default order method for product list.' => 'Domyślna metoda sortowania listy produktów.',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Domyślnie przycisk "Dodaj do koszyka" jest ukryty kiedy produkt jest niedostępny. Możesz wybrać aby był wyświetlany w każdym przypadku.',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Zalecane dla europejskich sprzedawców, aby byli zgodni z prawem (np.: Dostawa w ciągu 3-4 dni.)',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Zalecane dla europejskich sprzedawców, aby byli zgodni z prawem (np.: Dostawa w ciągu 5-7 dni.)',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Przy sprzedaży pakietów produktów, w jaki sposób chcesz ustawić odliczanie ze stanu?',
    'Contact name (e.g. Customer Support).' => 'Nazwa kontaktu (np. obsługa klienta).',
    'Emails will be sent to this address.' => 'Wiadomości e-mail będą wysyłane na ten adres.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Jeżeli włączone, wszystkie wiadomości zostaną zapisane na stronie "Obsługi Klienta" w menu "Klient"',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Wyświetla listę adresów, sposobu wysyłki i koszyk tuż przed przyciskiem zamówienia (wymagane w niektórych krajach europejskich).',
    'Allow guest visitors to place an order without registering.' => 'Zezwalaj odwiedzającym składać zamówienia bez rejestracji.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Wyłącz opcję, pozwalającą klientom powtórne zamawianie jednym kliknięciem z historii zamówień (wymagane w niektórych krajach europejskich).',
    'Set to 0 to disable this feature.' => 'Ustaw na 0, aby wyłączyć tę funkcję.',
    'Automatically updates the shipping costs when you edit an order.' => 'Automatycznie aktualizuje koszty wysyłki podczas edycji zamówienia.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Zezwól klientom na wysyłanie ich zamówień na kilka adresów. Ta opcja zamieni koszyk klienta w jedno lub więcej zamówień.',
    'Allows you to delay shipping at your customers\' request.' => 'Pozwala Ci odłożyć wysyłkę na życzenie klienta.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Wymagaj od klienta aby zaakceptował warunki korzystania z usługi przed przetworzeniem zamówienia',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Wybierz stronę zawierającą warunki korzystania z Twojego sklepu.',
    'Suggest gift-wrapping to customers.' => 'Zasugeruj klientowi pakowanie ozdobne i możliwość dodania wiadomości',
    'Set a price for gift wrapping.' => 'Ustal cenę opakowania ozdobnego.',
    'Set a tax for gift wrapping.' => 'Ustal podatek od pakowania ozdobnego.',
    'Suggest recycled packaging to customer.' => 'Sugeruj opakowanie z surowców wtórnych klientowi.',
    'You can search for a new domain name or add a domain name that you already own. You will be redirected to your PrestaShop account.' => 'Możesz wyszukać nową nazwę domeny lub dodać nazwę domeny, którą już posiadasz. Zostaniesz przekierowany do konta PrestaShop.',
    'Invalid characters:' => 'Nieprawidłowe znaki:',
    'Name of the related page.' => 'Nazwa powiązanej strony.',
    'Title of this page.' => 'Tytuł tej strony.',
    'A short description of your shop.' => 'Krótki opis Twojego sklepu.',
    'List of keywords for search engines.' => 'Lista słów kluczowych dla wyszukiwarek.',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'Na przykład, "kontakty" dla http://example.com/shop/contacts przekierować na http://example.com/shop/contact-form.php',
    'Only letters and hyphens are allowed.' => 'Tylko litery i znak minus (-) są dozwolone.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Zaznacz tę opcję, jeśli chcesz pokazać atrybuty produktu w meta tytule.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Włącz tą opcję, jeżeli Twój serwer zezwala na przepisywanie URL (zalecane).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'Przepisywanie URL (mod_rewrite) nie jest aktywne na Twoim serwerze lub nie jest możliwe sprawdzenie konfiguracji Twojego serwera. Jeżeli chcesz używać przyjaznych URL-i musisz aktywować tą funkcję.',
    'Enable this option if you want to allow accented characters in your friendly URLs.' => 'Włącz tą opcję, jeżeli chcesz zezwolić na użycie narodowych znaków w przyjaznych URL.',
    'You should only activate this option if you are using non-latin characters ; for all the latin charsets, your SEO will be better without this option.' => 'Powinieneś aktywować tą opcję tylko jeżeli używasz nie-łacińskich znaków; dla wszystkich łacińskich zestawów znaków Twoje SEO będzie lepsze bez tej opcji.',
    'Enable this option only if you have problems with URL rewriting.' => 'Włącz tą opcję tylko jeżeli masz problemy z przepisywaniem URL na niektórych stronach.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Niektóre opcje PrestaShop mogą nie funkcjonować poprawnie przy wyjątkowej konfiguracji modułu Apache mod_security . Rekomendowane jest jego wyłączenie.',
    'Activate or deactivate your shop (It is a good idea to deactivate your shop while you perform maintenance. Please note that the webservice will not be disabled).' => 'Aktywuj albo dezaktywuj swój sklep. Dobrym pomysłem jest dezaktywowanie sklepu kiedy wykonujesz czynności administracyjne. Pamiętaj że obsługa nie będzie wyłączona',
    'IP addresses allowed to access the front office even if the shop is disabled. Please use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96)' => 'Adresy IP z których można wejść do sklepu, nawet jeżeli jest wyłączony. Użyj przecinków aby je rozdzielić (np. 42.24.4.2,127.0.0.1,99.98.97.96)',
    'Custom text displayed on maintenance page while shop is deactivated.' => 'Niestandardowy tekst wyświetlany na stronie przerwy technicznej, podczas gdy sklep jest dezaktywowany.',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'Jeśli posiadasz certyfikat SSL dla nazwy domeny Twojego sklepu, można aktywować szyfrowanie SSL (https://) dla identyfikacji konta klienta i realizacji zamówień.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'Jeśli chcesz włączyć obsługę SSL na wszystkich stronach sklepu, aktywuj opcję "Włącz protokół SSL na wszystkich stronach" poniżej.',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'Po włączeniu wszystkie strony sklepu będą zabezpieczone protokołem SSL.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Włącz lub wyłącz token w "Front Office" w celu poprawy bezpieczeństwa PrestaShop.',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Pozwól na iframes w polach takich jak opis produktu. Zalecamy pozostawienie tej opcji wyłączone.',
