    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Opcja Multisklep jest włączona, jeżeli chcesz zmienić URL Twojego sklepu, musisz iść do strony "Multisklep" w menu "Zaawansowane".',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Ta sekcja pozwala na zmianę domyślnego schematu Twoich linków. Aby użyć tej funkcji, musi być włączona opcja "Przyjaznych adresów URL" w PrestaShop, a moduł przepisywania w Apache (mod_rewrite) musi być aktywny na Twoim serwerze.',
    'There are several available keywords for each route listed below; note that keywords with * are required!' => 'Jest kilka dostępnych słów kluczowych dla każdej z opisanej poniżej ścieżki; pamiętaj, ze słowa z * są wymagane!',
